import React from "react";
import "./SignInForm.css";
import "react-bootstrap";
import { FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import chatIcon from "../img/chat-app-icon.png";
import userIcon from '../img/userIcon.png'
import pwdIcon from '../img/passwordIcon.png'

const SignInForm = () => {
  return (

      <div className="wrapper">

              <div className="text-center pa-3"><img src={chatIcon} className="chatIcon" alt="chat-icon"></img></div>
              <div className="text-center mt4 name">Sign in to Chat</div>
             <form className="p-3 mt-3 text-center">
               <div className="form-field d-flex align-items-center"> <span> <img className="userIcon" src={userIcon}/> </span> <input type="text" name="userName" id="userName" placeholder="Username"></input></div>
               <div className="form-field d-flex align-items-center"> <span><img className="pwdIcon" src={pwdIcon}/></span> <input type="password" name="password" id="password" placeholder="Password"></input></div>
               <button className="btn mt-3">Login</button>
                </form>
                <div className="text-center fs-6"> Not a member? <a href="#">Sign Up</a></div>
                <div className="text-center fs-6"> Or <a href="#">Continue as Guest</a></div>
           </div>
  );
};

export default SignInForm;
